    sp_name = #{spName,jdbcType=CHAR},


    rec_crt_ts = #{recCrtTs,jdbcType=TIMESTAMP},


    rec_upd_ts = #{recUpdTs,jdbcType=TIMESTAMP},


where sp_id = #{spId,jdbcType=CHAR}
  and call_dt = #{callDt,jdbcType=CHAR}

